window.bookSummaryJSON = "<p>Beatrice De Novo thought she had left the supernatural world behind... for the most part. But when the past becomes the present, will she leave her quiet life in Los Angeles to follow a mystery she thought had abandoned her? Where has Giovanni Vecchio been, and why has he returned? Giovanni has his own questions, and he's looking to her for answers.</p> <p><i>This Same Earth</i> reunites Beatrice and Giovanni to continue their search through the past while both wrestle with the future. When the world as you knew it has changed forever, is there any way you can turn back?</p>"; 
